import React from 'react';
import { Link } from 'react-router-dom';

const TrialEnded = () => {
  return (
    <div className="min-h-screen bg-gray-100 flex items-center justify-center">
      <div className="bg-white p-8 rounded-lg shadow-md max-w-md w-full text-center">
        <h1 className="text-2xl font-bold mb-4">Your Free Trial Has Ended</h1>
        <p className="mb-6">
          Thank you for trying out AUTOLAWN! Your 7-day free trial has now ended.
          To continue using the application, please upgrade your subscription.
        </p>
        <Link
          to="/pricing"
          className="bg-blue-500 text-white px-6 py-2 rounded-md text-lg font-medium hover:bg-blue-600 transition duration-300"
        >
          Upgrade Now
        </Link>
      </div>
    </div>
  );
};

export default TrialEnded;
